import React, { Component } from 'react'
import PureComp from './PureComp'
import RegComp from './RegComp'

class ParentComp extends Component {
    constructor(props) {
      super(props)
    
      this.state = {
         name : 'umang'
      }
    }
    
    componentDidMount() {
        setInterval(() => {
            this.setState({
                name : 'umang'
            })
        },2000)
    }

    render() {
        return (
          <div>
            Parent Component
            <RegComp name={this.state}></RegComp>
            <PureComp></PureComp>
          </div>
        )
    }
}

export default ParentComp
